//Avg Session time =  Total Session Time / sessions per IP

val avg_sessions = sqlContext.sql( "SELECT SUM(total_session_time_per_ip) AS amount_of_time, SUM(sessions_per_ip) AS num_of_sessions,(SUM(total_session_time_per_ip) / SUM(sessions_per_ip)) / 60 AS average_session_time_in_mins FROM ( SELECT client_ip, MAX(session_id) AS sessions_per_ip, SUM(session_time) AS total_session_time_per_ip  FROM ( SELECT client_ip, session_id, MAX(unix_timestamp(timestamp)) - MIN(unix_timestamp(timestamp)) AS session_time FROM weblogSessions_ByIds GROUP BY client_ip, session_id ORDER BY client_ip, session_id ) grouped_sessions GROUP BY client_ip ) average_sessions")

avg_sessions.coalesce(1).write.csv("s3://sessionize-weblogs/avg_sessions")
